                <div className="col">
                {data.map((item)=>(
              <div>
              <p><img src={item.image} style={{width:"200px",height:"200px"}}/> </p>
              <h3>{item.brand}</h3>
              <p>{item.name}</p>
              <p>{item.price}</p>
              </div>
  
            ))}  
                    
                </div>
                <div className="col">
                
                </div>
                <div className="col">
                    
                </div>
            </div>


            

            
        </div>




    )

}
export default Ecdata;
